import React from 'react';
import styled from 'styled-components';

const List = () => {
  return (
    <Wrapper>
      <div className='grade'>S</div>
      <div className='team'>
        <div className='team-title'>Bruiser Warrios</div>
        <div className='team-style'>Slow Roll (7)</div>
      </div>
      <ul className='team-comps'>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
        <li className='teammates'>
          <img src='https://rerollcdn.com/characters/Base/Jinx.png' alt='' />
          <div className='teammates-name'>Jinx</div>
        </li>
      </ul>
    </Wrapper>
  );
};

export default List;

const Wrapper = styled.div`
  display: flex;

  & .grade {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 25px;
    height: 25px;
    padding: 5px;
    margin-right: 20px;
    color: #0d202b;
    font-weight: 600;
    border-radius: 2.5px;
    cursor: default;
    background: #ff7f7f;
  }

  & .team {
    &-title {
      color: rgba(255, 255, 255, 0.9);
      font-weight: 500;
    }
    &-style {
      display: inline-flex;
      align-items: center;
      color: #88a0a7;
      font-size: 12px;
      font-weight: 400;
      letter-spacing: 0.05em;
      margin-top: 2px;
      background: #123040;
      padding: 2px 4px;
      border-radius: 4px;
    }
    &-comps {
      display: flex;
      & .teammates {
        & img {
          border: 1px solid red;
          width: 45px;
          height: 45px;
          min-width: 45px;
          min-height: 45px;
        }
        &-name {
        }
      }
    }
  }
`;
